import productsData from "../../../data.js";

const MostPopular = () => {
  return (
    <div className="container most-popular">
      <div className="row">
        {productsData.map((items) => {
          <div className="col-3">
            <div class="card">
              <img
                src={items.productImage}
                class="card-img-top"
                alt="product"
              />
              <div class="card-body">
                <h5 class="card-title">{items.productTitle}</h5>
                <p class="card-text">{items.productDetial}</p>
                <a href="#" class="btn btn-primary">
                  Go somewhere
                </a>
              </div>
            </div>
          </div>;
        })}
      </div>
    </div>
  );
};

export default MostPopular;
